        async function searchFarmAddress(searchText) {
            // Verify map is initialized
            if (!map || typeof map.setMapTypeId !== 'function') {
                throw new Error('Map not initialized properly');
            }

            // Verify Google Maps is loaded
            if (!window.google || !window.google.maps) {
                throw new Error('Google Maps not loaded properly');
            }

            // Validate search text
            if (!searchText || typeof searchText !== 'string') {
                throw new Error('Invalid search text provided');
            }
            
            const search = searchText.toLowerCase().trim();
            if (!search) {
                throw new Error('Please enter a search term');
            }

            // Search for location
            const foundLocation = farmLocations.find(loc => 
                loc && loc.address && loc.address.toLowerCase().includes(search)
            );
            
            if (foundLocation) {
                // Clear previous marker and info window if they exist
                if (currentMarker) {
                    currentMarker.setMap(null);
                }
                if (currentInfoWindow) {
                    currentInfoWindow.close();
                }
                
                // Create a new marker
                currentMarker = new google.maps.Marker({
                    map: map,
                    position: { lat: foundLocation.lat, lng: foundLocation.lng },
                    animation: google.maps.Animation.DROP
                });

                // Create and open info window
                currentInfoWindow = new google.maps.InfoWindow({
                    content: `<div class="info-window">${foundLocation.address}</div>`
                });
                currentInfoWindow.open(map, currentMarker);

                // Center and zoom the map
                map.setCenter({ lat: foundLocation.lat, lng: foundLocation.lng });
                map.setZoom(18);
            }
            
            return foundLocation;
        }

        function geocodeAddress(address) {
            if (!map) {
                return Promise.reject('Map is not ready yet. Please try again in a moment.');
            }

            if (!google || !google.maps) {
                return Promise.reject('Google Maps is not loaded. Please refresh the page.');
            }
            
            // First try to find the address in our farm locations
            const farmLocation = searchFarmAddress(address);
            if (farmLocation) {
                const location = { lat: farmLocation.lat, lng: farmLocation.lng };
                
                // Verify map is initialized
                if (!map || typeof map.setMapTypeId !== 'function') {
                    throw new Error('Map not properly initialized');
                }
                
                // Set map options
                map.setMapTypeId('hybrid');
                map.setCenter(location);
                map.setZoom(18);  // Zoom level for clear farm/property view
                
                // Create a marker at the location
                const marker = new google.maps.Marker({
                    map: map,
                    position: location,
                    animation: google.maps.Animation.DROP
                });

                // Create an info window with the address
                const infoWindow = new google.maps.InfoWindow({
                    content: `<div class="info-window">${farmLocation.address}</div>`
                });

                // Open the info window when marker is clicked
                marker.addListener('click', () => {
                    infoWindow.open(map, marker);
                });

                // Open info window immediately
                infoWindow.open(map, marker);
                
                return Promise.resolve(location);
            }

            // If not found in farm locations, try geocoding (as fallback)
            const geocoder = new google.maps.Geocoder();
            return new Promise((resolve, reject) => {
                geocoder.geocode({ address: address }, (results, status) => {
                    if (status === 'OK' && results && results[0]) {
                        const location = results[0].geometry.location;
                        
                        // Set to satellite with labels (hybrid mode)
                        map.setMapTypeId('hybrid');
                        map.setCenter(location);
                        map.setZoom(18);  // Zoom level for clear farm/property view
                    
                        // Create a marker at the location
                        const marker = new google.maps.Marker({
                            map: map,
                            position: location,
                            animation: google.maps.Animation.DROP
                        });

                        // Create an info window with the address
                        const infoWindow = new google.maps.InfoWindow({
                            content: `<div class="info-window">${address}</div>`
                        });

                        // Open the info window when marker is clicked
                        marker.addListener('click', () => {
                            infoWindow.open(map, marker);
                        });

                        // Open info window immediately
                        infoWindow.open(map, marker);
                        
                        resolve(location);
                    } else {
                        reject('Geocoding failed: ' + status);
                    }
                });
            }).catch(error => {
                console.error('Error in geocoding:', error);
                return null;
            });
        }

        function searchAddress() {
            const address = document.getElementById('search-box').value;
            if (address) {
                const farmLocation = searchFarmAddress(address);
                if (farmLocation) {
                    const location = { lat: farmLocation.lat, lng: farmLocation.lng };
                    map.setMapTypeId(google.maps.MapTypeId.HYBRID);
                    map.setCenter(location);
                    map.setZoom(18);

                    // Create a marker
                    const marker = new google.maps.Marker({
                        map: map,
                        position: location,
                        animation: google.maps.Animation.DROP
                    });

                    // Create info window
                    const infoWindow = new google.maps.InfoWindow({
                        content: `<div class="info-window">${farmLocation.address}</div>`
                    });

                    marker.addListener('click', () => {
                        infoWindow.open(map, marker);
                    });

                    infoWindow.open(map, marker);
                } else {
                    alert('Address not found in our farm locations. Please try another address.');
                }
            }
        }

            const BATCH_SIZE = 50;

            document.getElementById('search-button').addEventListener('click', () => {

                const address = searchBox.value;
                if (address) {

                    }
                }
            });

            function processBatch() {
                const batch = locations.slice(processedCount, processedCount + BATCH_SIZE);
                
                batch.forEach(location => {
                    const marker = new google.maps.Marker({
                        position: { lat: location.lat, lng: location.lng },
                        map: map,
                        icon: {

                            ${location.city}, ${location.state} ${location.zip}</p>
                        </div>
                    `;

                    // Add click listener to show info window
                    marker.addListener('click', () => {
                        if (activeInfoWindow) {
                            activeInfoWindow.close();
                        }
                        const infoWindow = new google.maps.InfoWindow({
                            content: content
                        });
                        infoWindow.open(map, marker);
                        activeInfoWindow = infoWindow;
                    });

                });
        }

        // Handle address search
        async function searchAddress() {
            const loadingDiv = document.getElementById('loading');
            const searchBox = document.getElementById('search-box');
            const searchInput = searchBox ? searchBox.value.trim() : '';
            
            if (!searchInput) {
                alert('Please enter an address to search');
                return;
            }

            try {
                // Show loading
                loadingDiv.style.display = 'flex';
                loadingDiv.textContent = 'Searching...';

                // Clear previous markers if any
                markers.forEach(marker => marker.setMap(null));
                markers = [];

                console.log('Searching for:', searchInput);  // Debug log

                // Search for matching locations
                const matchingLocations = farmLocations.filter(location => {
                    const locationAddress = location.address.toLowerCase();
                    const searchTerm = searchInput.toLowerCase();
                    console.log('Comparing:', locationAddress, searchTerm);  // Debug log
                    return locationAddress.includes(searchTerm);
                });

                console.log('Found matches:', matchingLocations.length);  // Debug log

                if (matchingLocations.length === 0) {
                    alert('Address not found in our farm locations. Please try another address.');
                    // Restore all markers
                    farmLocations.forEach(location => {
                        const marker = addMarker(location);
                        markers.push(marker);
                    });
                    return;
                }

                // Show matching locations
                matchingLocations.forEach(location => {
                    const marker = addMarker(location);
                    markers.push(marker);
                });

                // Center on first match
                if (matchingLocations.length > 0) {
                    const firstMatch = matchingLocations[0];
                    map.setCenter({ lat: firstMatch.lat, lng: firstMatch.lng });
                    map.setZoom(12);
                }
            } catch (error) {
                console.error('Search error:', error);
                alert('An error occurred while searching. Please try again.');
            } finally {
                loadingDiv.style.display = 'none';
            }
        }

        // Set up event listeners for search functionality
        function setupSearchHandlers() {
            // Add search button click handler
            document.getElementById('search-button').addEventListener('click', searchAddress);
            
            // Add enter key handler for search box
            document.getElementById('search-box').addEventListener('keypress', function(e) {
                if (e.key === 'Enter') {
                    searchAddress();
                }
            });
        }

        // Global variable to track initialization
        let mapInitialized = false;

        // Set up the page when loaded
        window.addEventListener('load', async () => {
            try {
                await initMap();
                mapInitialized = true;
                setupSearchHandlers();
                console.log('Map initialization complete');
            } catch (error) {
                console.error('Failed to initialize map:', error);
                document.getElementById('loading').textContent = 'Error loading map: ' + error;
            }
        });
    </script>
